import React from "react";
import "./Navbar.css";

const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="navbar-container">
        <div className="logo">
          Digital Gram Panchayat
        </div>

        <ul className="nav-links">
          <li>Home</li>
          <li>Services</li>
          <li>Schemes</li>
          <li>Contact</li>
        </ul>

        <button className="login-btn">Login</button>
      </div>
    </nav>
  );
};

export default Navbar;
